// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract StudentInfo
{
    mapping (string => address) public student_wallet;
    uint256 public balance;
    Grade public grades;
}

struct Grade
{
    uint32 mark1; // 70
    uint32 mark2; // 80
    uint32 mark3; // 90
}

enum StudentType
{
    GOOD,
    BAB,
    GREAT
}

